import axios from 'axios';
import { parse } from '@babel/parser';
import traverse from '@babel/traverse';
import * as t from '@babel/types';

const IconSet = new Map();

async function getCdn(name) {
    try {
        if (IconSet.has(name)) {
            return IconSet.get(name);
        }
        const result = await axios.get(`https://cdn.dsmcdn.com/seller-ads/editor/resources/${name}.svg`);
        IconSet.set(name, result.data);
        return result.data;
    }
    catch (e) {
        console.error(`svg component not found on server, name: ${name}`);
    }
}

const optimusPlugin = () => {
    const iconSet = new Set();
    return {
        name: 'optimus-bundle',
        transform(code, id) {
            if (!id.endsWith('.jsx') && !id.endsWith('.tsx')) {
                return null;
            }
            const ast = parse(code, {
                sourceType: 'module',
                plugins: ['jsx', 'typescript'],
            });
            if (id ===
                '/Users/ibrahim.dagdelen/Projects/Github/icon-usage-benchmark/svg-converter-demo/src/App.tsx') {
                console.log('ast');
            }
            traverse.default(ast, {
                JSXElement(path) {
                    console.log('asdfasd');
                    const openingElement = path.node.openingElement;
                    if (t.isJSXIdentifier(openingElement.name, { name: 'ty-icon' })) {
                        console.log('sadfads');
                    }
                },
                CallExpression(path, opts) {
                    const callee = path.node.callee;
                    if (t.isJSXElement(callee)) {
                        const jsxElement = callee;
                        const newChild = t.jsxText('Yeni Child Metni');
                        if (!jsxElement.openingElement.attributes) {
                            jsxElement.children = [];
                        }
                        jsxElement.children.push(newChild);
                        console.log('Yeni child eklendi:', newChild);
                    }
                },
            });
            return {
                code: code,
            };
        },
        async buildEnd() {
            const icons = Array.from(iconSet);
            for (const icon of icons) {
                await getCdn(icon);
            }
            console.log('\nOptimus Icons:', Array.from(iconSet));
        },
    };
};

export { optimusPlugin };
